import React from "react";
import "./App.css"

function OneName(props) {
  let babyColor = "";
  if ((props.sex = "m")) {
    babyColor = "nameBoy";
  } else {
    babyColor = "nameGirl";
  }
  return (
    <div>
      <p class={babyColor}> {props.name} </p>
    </div>
  );
}

export default OneName;
